def highest_frequency_chars(phrase):
    phrase = phrase.lower()
    counts = {}
    max_count = 1
    for char in phrase:
        if char.isalpha():
            counts[char] = counts.get(char, 0) + 1
            max_count = max(max_count, counts[char])
    return [char for (char, count) in counts.items() if count == max_count]

